(39, 1, '2014-02-20 08:32:39', '2014-02-20 08:32:39', 'Dear colleagues,\r\n<p style="margin-top: 30px;">You want to have a high quality computer service in your organization but do not want to pay extra money for a computer specialist, thus, the subscriber''s computer service offered by our organization is just what you need.\r\nThe service suggested by ''''Q''''-IT is much cheaper than having a specialist-employee in your company. The whole process connected with the service work is done by contract.</p>\r\n<p style="margin-top: 20px;">Our Clients</p>\r\nOur main customers are small and medium enterprises and organizations having departments both in Armenia and in Yerevan, these are the enterprises or shops of the perfume, clothes, construction materials and etc...\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Local Network Regulation</a>\r\n\r\nWe provide your organization''s local computer network configuration on the basis of cable and satellite, Internet connection configuration, updating of the existing network, giving advice for improving the local network, failures of diagnosis.\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Computer Service</a>\r\n\r\nWe also realize computer renovation, reinstallation of the operating system with maintaining all data (information), deleted data(information) recovery, the replacing of the equipment, system modernization, obstructed components diagnostic, further service of the computers, as well as an all day IT service.\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Server System Investment and Service</a>\r\n\r\nWe offer complete service list for the maintenance servers of your company: Domain network investment, email server regulation and the protection from the spam, the organization of data reserve copying, organizing the servers'' reliability and security.\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Digital Watch System Investment and Service</a>\r\n\r\nWe introduce to you equipment offer with professional consultation taking into account price/quality parameter. We realize the installation, the regulation and the further service of the watch system (cameras and video recording computers).\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Goods Movement and Points of Sale Software</a>\r\n\r\nWe cooperate with different organizations, which are specialized in trade, catering and in other sphere organizations'' internal movement of goods warehouses and the organization of the sale outlets with the creation and the installation of total computer program. Due to this program it is possible to control the movement and the sale of the commercial goods at any time.\r\nToday there are such programs implementing the above listed actions in many organizations but in many cases the labor issues of the reserve backup databases and software systems for safe and secure are not solved.\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Electronic Information Security Management</a>\r\n\r\nIn many organizations the prevention measures of electronic data loss, the accidental or intentional delete of files by the staff are not implemented. We also solve these problems due to the creation of powerful and protected computer network.\r\nThus, the advantages while working with us are the high operativeness, high quality services, access to services, the high service of the computer problems in time, not being dependent from one employee, rendering an individual approach to each client.\r\n\r\n<a style="margin-top: 20px; float: left; width: 100%;">We will be glad to cooperate...</a>\r\n<a style="margin-top: 20px; float: right;">Thank you for using our services</a>\r\n<p style="margin-top: 53px; text-align: right; margin-bottom: 28px;"><b>"Q"</b>IT Staff</p>', 'IT ', '', 'publish', 'closed', 'closed', '', 'it', '', '', '2014-10-31 09:57:33', '2014-10-31 09:57:33', '', 0, 'http://q-grup.shahumyanmedia.com/?page_id=39', 39, 'page', '', 0),
