(79, 1, '2014-02-20 11:03:44', '2014-02-20 11:03:44', '<p>Dear colleagues,</p>\r\n<p>There are often some cases when the employees working in companies, organizations and enterprises don''t master the required foreign languages and computer skills properly, with the regard to their working duties or passing to a higher position.\r\nFor solving such kind of problems "Q" Training Center suggests language and computer trainings which are held in high level. In "Q" Training Center only high qualified specialists teach who have a big experience in the sphere of teaching. By the request of the client the trainings can also be held in the client organization''s premises. The trainings are held both in individual and in group versions.</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Language trainings</span> include English (<a href="#" style="text-decoration:none;">General English</a>, Business English,Economic English,Spoken course of English, Accelarated course of English ), German, French, Spanish, Italian, Russian, Turkish, Persian, Arabian, Armenian and other</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Computer trainings </span> include trainings for the beginners (Word, Excel, Outlook and etc.)-the duration is 2 months</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Design Programs </span> Adobe Photoshop, Adobe Illustrator, Adobe InDesign, CorelDraw, 3DStudio Max, Macromedia Flash, Adobe Premier Pro, Adobe After Effect</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Courses for program languages </span> C++ for the beginners, C++, C# + .Net, PHP+, My SQL, HTML+ Java Script + CSS, MS SQL, Objective C</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Windows operation systems </span> based on them (Active Directory, DNS, DHCP, RRAS, TS, VPN, Fileserver and etc.)-the duration is 3,5 months</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Linux operation systems</span> based on them (NTP, TFTP, FTP, SELinux, GPG and etc.) - the duration is 5 months.</p>', 'Education', '', 'inherit', 'open', 'open', '', '67-revision-v1', '', '', '2014-02-20 11:03:44', '2014-02-20 11:03:44', '', 67, 'http://q-group.shahumyanmedia.com/67-revision-v1/', 0, 'revision', '', 0),
