(84, 1, '2014-02-20 11:10:39', '2014-02-20 11:10:39', 'The course is considered to be a General English Course for all levels learners during which the development, improvement and practice of four language skills will be hypothesized. Learners are expected to acquire oral and written communication skills in professional and academic settings throughout the course. Students are expected to be familiar with internet and have at least low literacy of computer skills.\r\n<p style="margin-top: 15px;">Learning Outcomes:</p>\r\nBy the end of the course, the students will:\r\n<div style="margin-left: 40px; margin-top: 20px;">\r\n\r\nImprove communicative speaking skills in the target language through oral-visual interaction.\r\n\r\nDevelop, improve and practice the language skills of listening, speaking, reading, and writing.\r\n\r\nDevelop Blog writing\r\n\r\nGet proficiency of Using Social Networks (blogs, wikis)\r\n\r\nDevelop critical thinking\r\n\r\n</div>', 'General English', '', 'publish', 'closed', 'closed', '', 'general-english', '', '', '2014-10-31 09:57:12', '2014-10-31 09:57:12', '', 0, 'http://q-group.shahumyanmedia.com/?page_id=84', 37, 'page', '', 0),
