(141, 1, '2014-02-21 07:09:58', '2014-02-21 07:09:58', '<p>Հարգելի գործընկեր,</p>\r\n<p style="margin-top:30px;">Դուք ցանկանում եք ունենալ համակարգչային որակյալ սպասարկում Ձեր կազմակերպությունում, բայց չեք ցանկանում ավելորդ գումար վճարել համակարգչային մասնագետին, ապա մեր կազմակերպության կողմից առաջարկվող աբոնենտային համակարգչային սպասարկումը հենց այն է, ինչ Ձեզ պետք է:Մեր կողմից մատուցվող ծառայությունը շատ ավելի մատչելի է, քան հաստիքում համակարգչային մասնագետ ունենալը: Համակարգչային սպասարկման բոլոր աշխատանքները կատարվում են պայմանագրով:</p>\r\n<p style="margin-top:20px;">Մեր պատվիրատուները/p>\r\n<p >Մեր հիմնական պատվիրատուներն են ողջ հանրապետությունում և Երևան քաղաքում ստորաբաժանումներ ունեցող կազմակերպությունները, փոքր և միջին գրասենյակները, Օրինակ`հագուստի, օծանելիքի, շինանյութի, սննդի և այլ ոլորտի խանութներ կամ ձեռնարկություններ:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Լոկալ ցանցի կարգավորում</a>\r\n<p >Իրականացնում ենք Ձեր կազմակերպության լոկալ համակարգչային ցանցի կարգավորում ինչպես մալուխային, այնպես էլ օդային հիմքի վրա, ինտերնետին միանալու կարգավորում, առկա ցանցի արդիականացում, լոկալ ցանցի բարելավման խորհրդհատվություն, խափանումների դիագնոստիկա:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Համակարգչային սպասարկում</a>\r\n<p >Կատարում ենք համակարգչային վերանորոգում, օպերացիոն համակարգի վերատեղադրում բոլոր տվյալների պահպանմամբ, ջնջված ինֆորմացիայի վերականգնում, մասերի փոպարինում, համակարգի արդիականացում, խափանված կոմպոնենտների դիագնոստիկա, համակարգիչների հետագա սպասարկում, ինչպես նաև տեղեկատվական տեխնոլոգիաների շուրջօրյա սպասարկում:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Սերվերային համակարգերի ներդնում և սպասարկում</a>\r\n<p >Առաջարկում ենք Ձեր կազմակերպության սերվերների սպասարկման ամբողջական ծառայությունների ցանկ. դոմենային ցանցի ներդնում, փոստային սերվերների կարգավորում և պաշտպանություն սպամից, տվյալների ռեզերվային պատճենահանման կազմակերպում, սերվերների աշխատանքի հուսալիության և անվտանգության կազմակերպում:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Թվային դիտման համակարգերի ներդնում և սպասարկում</a>\r\n<p >Ներկայացնում ենք սարքավորումների առաջարկներ մասնագիտական խորհրդատվությամբ` ելնելով գին/որակ պարամետրից: Իրականացնում ենք տեսադիտման համակարգի (տեսախցիկների և տեսաձայնագրման համակարգիրների) տեղադրում, կարգավորում և հետագա սպսարկում:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Ապրանքի շարժի և վաճառքի կետերի ծրագրեր</a>\r\n<p >Մենք համագործակցում ենք տարբեր կազմակերպությունների հետ, որոնք մասնագիտացված են առևտրի, սննդի և այլ ոլորտի կազմակերպությունների ապրանքային պահեստների ներքին շարժի, վաճառքի կետերի կազմակերպման մեկ ընդհանուր համակարգչային ծրագրի ստեղծմամբ և ներդրմամբ: Տվյալ ծրագրի շնորհիվ հնարավորություն է տրվում վերահսկել ողջ առևտրային ապրանքի շարժը և վաճառքը ժամանակի ցանկացած պահին:\r\nԱյսօր բազմաթիվ կազմակերպություններում գործում են վերը նշված նման գործողություններ իրականացնող ծրագրեր, բայց շատ դեպքերում լուծված չեն տվյալների բազաների ռեզերվային արխիվացման և ողջ ծրագրային համակարգի անխափան և անվտանգ աշխատանքի հարցերը:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Էլեկտրոնային ինֆորմացիայի անվտանգության կազմակերպում</a>\r\n<p >Բազմաթիվ կազմկերպություններում իրականացված չեն էլեկտրոնային ինֆորնացիայի կորուստների, աշխատակիցների կողմից ֆայլերի պատահական կամ դիտավորյալ ջնջման կանխման միջոցառումներ: Մենք լուծում ենք նաև այդ խնդիրները հզոր և պաշտպանված համակարգչային ցանց կառուցելու շնորհիվ:\r\nԱյսպիսով, մեզ հետ աշխատելու առավելություններն են բարձր օպերատիվությունը, ծառայությունների բարձր որակը, ծառայությունների մատուցման մատչելիությունը, մեկ աշխատակցից կախվածություն չունենալը, յուրաքանչյուր պատվիրատուի հանդեպ անհատական մոտեցում ցուցաբերելը, համակարգչային խնդիրների ժամանակին և որակյալ սպասարկումը:</p>\r\n<a style="margin-top:20px;float: left;width: 100%;">Ուրախ կլինենք համագործակցել:</a>\r\n<a style="margin-top:20px;float: right;">Շնորհակալություն մեր ծառայություններից օգտվելու համար:</a><br/>\r\n<p style="margin-top:53px;text-align: right;margin-bottom: 28px;"><b>"Q" IT</b> խումբ:</p>', 'ՏՏ Աութսորսինգ', '', 'inherit', 'open', 'open', '', '110-revision-v1', '', '', '2014-02-21 07:09:58', '2014-02-21 07:09:58', '', 110, 'http://q-group.shahumyanmedia.com/110-revision-v1/', 0, 'revision', '', 0),
(142, 1, '2014-02-21 07:10:27', '2014-02-21 07:10:27', '<p>Հարգելի գործընկեր,</p>\r\n<p>Հաճախ կազմակերպություններում լինում են դեպքեր, երբ աշխատակիցները, աշխատանքային պարտականություւններից ելնելով կամ այլ պաշտոնի նշանակման հետ կապված, պատշաճ մակարդակով չեն տիրապետում տարբեր օտար լեզուների և համակարգչային տարրական գիտելիքների:\r\nՆման խնդիրների լուծման համար "Q" ուսումնական կենտրոնն առաջարկում է լեզվաբանական և համակարգչային դասընթացներ: Մեզ մոտ դասավանդում են բարձրակարգ մասնագետներ, որոնք մեծ փորձ ունենդասավանդմանոլորտում: Պատվիրատուների խնդրանքով դասընթացներն անցկացվում են նաև պատվիրատուի կազմակերպության տարածքում: Դասընթացները անցկացվում են և'' խմբակային, և'' անհատական տարբերակով:</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Լեզվաբանական դասընթացներ`</span> Անգլերեն (ընդհանուր անգլերեն, բիզնես, տնտեսագիտական անգլերեն, անգլերենի խոսակցական դասընթաց,արագացված դասընթաց և այլն), Գերմաներեն, Ֆրանսերեն, Իսպաներեն, Իտալերեն, Ռուսերեն, Հայերեն և այլ:</p>\r\n<p style="margin-top:15px;"><span style="font-weight:bold;">Համակարգչային դասընթացներ` </span> Համակարագչային դասընթացներ սկսնակների համար (համակարգչային տարրական գիտելիքներ, Word, Excel, Outlook և այլն) - տևողությունը 2 ամիս:s</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Դիզայներական ծրագրեր </span> Adobe Photoshop, Adobe Illustrator, Adobe InDesign, CorelDraw, 3DStudio Max, Macromedia Flash, Adobe Premier Pro, Adobe After Effect</p>\r\n<p style="margin-top:15px;"><span style="font-weight:bold;">Ծրագրավորման լեզուների դասընթացներ</span> C++ Սկսնակների համար, C++, C# + .Net, PHP+My SQL, HTML+ Java Script + CSS, MS SQL, Objective C</p>\r\n<p style="margin-top:15px;"><span style="font-weight:bold;">Windows օպերացիոն համակարգեր և նրանց հենքի վրա հիմնված սերվերային համակարգեր(Active Directory, DNS, DHCP, RRAS, TS, VPN, Fileserver և այլն) </span> տևողությունը 3.5 ամիս:</p>\r\n<p style="margin-top:15px;"><span style="font-weight:bold;">Linux օպերացիոն համակարգեր և նրանց հենքի վրա հիմնված համակարգեր (RHEL/C (NTP,TFTP, FTP, SELinux, GPG և այլն)</span>տևողությունը 5 ամիս:</p>\r\n<div style="text-align:center;margin-top:25px;">Ուրախ կլինենք համագործակցել:</div>\r\n<a style="margin-top:20px;float: right;">Շնորհակալություն մեր ծառայություններից օգտվելու համար:</a><br/>\r\n<p style="margin-top:32px;text-align: right;margin-bottom: 28px;">"Q" ուսումնական կենտրոնի խումբ:­</p>', 'Ուսումնական Կենտրոն', '', 'inherit', 'open', 'open', '', '112-revision-v1', '', '', '2014-02-21 07:10:27', '2014-02-21 07:10:27', '', 112, 'http://q-group.shahumyanmedia.com/112-revision-v1/', 0, 'revision', '', 0),
(143, 1, '2014-02-21 07:10:48', '2014-02-21 07:10:48', '<b>Кабельные системы\r\n</b>Кабельная система объединяет локальную компьютерную сеть и телефонные сети, систему безопасности и т.п. Компания Q Group предлагает услуги по установке и обслуживанию как целостной системы, так и ее отдельных компонентов.\r\n\r\n&nbsp;\r\n\r\n<b>Предпроектное исследование\r\n</b>Мы осуществляем проверку технического состояния и качества кабельных систем, определение категории планируемой кабельной системы, сроков работ, планирование бюджета.\r\n\r\n&nbsp;\r\n\r\n<b>Проектирование\r\n</b>Проектирование осуществляется нашими опытными специалистами на основании всей собранной информации и при взаимодействии с заказчиком.\r\n\r\n&nbsp;\r\n\r\n<b>Выполнение проекта\r\n</b>На основании уже имеющегося проектного документа с применением необходимых устройств и материалов осуществляется проводка кабелей (проверка качества – Fluke Test), установка оборудования.\r\n\r\n&nbsp;\r\n\r\n<b>Системы цифрового </b><b>видео</b><b>наблюдения\r\n</b>Компания Q Group выполняет установку, наладку (видеозапись, аудиозапись, возможность online  наблюдения) обеспечивающих безопасность IP видеокамер, DVR (цифровых видеорегистраторов).\r\n\r\n&nbsp;\r\n\r\n<b>АТС (Автоматическая телефонная станция)\r\n</b>Мы предлагаем услуги по проведению сетей телефонных систем (кабелизация).\r\n<p style="text-align: right;">Благодарим за сотрудничество,</p>\r\n<p style="text-align: right;"><a>Группа Q-IT</a></p>', 'Интегратор ИТ', '', 'publish', 'closed', 'closed', '', '%d0%b8%d0%bd%d1%82%d0%b5%d0%b3%d1%80%d0%b0%d1%82%d0%be%d1%80_%d0%b8%d1%82', '', '', '2014-05-27 12:40:59', '2014-05-27 12:40:59', '', 0, 'http://q-group.shahumyanmedia.com/?page_id=143', 38, 'page', '', 0),
