(183, 1, '2014-02-21 09:01:04', '2014-02-21 09:01:04', '<p style="margin-bottom:30px;">Уважаемые коллеги,</p>\n<p>Часты случаи, когда работники компаний, исходя из служебной необходимости либо при переводе на другую должность, не владеют иностранными языками или навыками работы на компьютере в достаточной степени.</p>\n<p style="margin-top:15px;">Для решения подобных задач учебный центр «Q» предлагает курсы иностранных языков и компьютерные курсы.</p>\n<p style="margin-top:15px;">У нас преподают высококвалифицированные преподаватели, имеющие многолетний стаж работы.</p>\n<p style="margin-top:15px;">Занятия проводятся как в обустроенной комфортабельной аудитории центра, так и, в случае желания, на территории компании клиента. По выбору клиента, занятия могут быть групповыми и индивидуальными.</p>\n<p style="margin-top:15px;">Помимо организаций, в число наших клиентов входят и частные лица.</p>\n<p style="margin-top:15px;"><span style="font-weight:bold;">Иностранные языки</span></p>\n<p style="margin-top:15px;">Английский (все уровни, ускоренный курс, разговорный курс)</p>\n<p >Французский</p>\n<p >Немецкий</p>\n<p >Испанский</p>\n<p >Итальянский</p>\n<p >Русский </p>\n<p style="margin-top:15px;"><span style="font-weight:bold;">Компьютерные курсы</span></p>\n<p style="margin-top:15px;">Для начинаюних (элементарные навыки, Word, Excel, Outlook и т.д.) - 2 месяца</p>', 'Учебный Центр', '', 'inherit', 'open', 'open', '', '143-autosave-v1', '', '', '2014-02-21 09:01:04', '2014-02-21 09:01:04', '', 143, 'http://q-group.shahumyanmedia.com/143-autosave-v1/', 0, 'revision', '', 0),
(184, 1, '2014-02-21 08:56:16', '2014-02-21 08:56:16', '<p>Уважаемые коллеги,</p>\r\n<p>Часты случаи, когда работники компаний, исходя из служебной необходимости либо при переводе на другую должность, не владеют иностранными языками или навыками работы на компьютере в достаточной степени.\r\nДля решения подобных задач учебный центр «Q» предлагает курсы иностранных языков и компьютерные курсы.</p>\r\n<p style="margin-top:30px;">У нас преподают высококвалифицированные преподаватели, имеющие многолетний стаж работы.</p>\r\n<p style="margin-top:30px;">Занятия проводятся как в обустроенной комфортабельной аудитории центра, так и, в случае желания, на территории компании клиента. По выбору клиента, занятия могут быть групповыми и индивидуальными.</p>\r\n<p style="margin-top:30px;">Помимо организаций, в число наших клиентов входят и частные лица.</p>\r\n<p style="margin-top:30px;"><span style="font-weight:bold;">Иностранные языки</span></p>\r\n<p style="margin-top:15px;">Английский (все уровни, ускоренный курс, разговорный курс)</p>\r\n<p style="margin-top:15px;">Французский</p>\r\n<p style="margin-top:15px;">Немецкий</p>\r\n<p style="margin-top:15px;">Испанский</p>\r\n<p style="margin-top:15px;">Итальянский</p>\r\n<p style="margin-top:15px;">Русский </p>', 'Учебный Центр', '', 'inherit', 'open', 'open', '', '143-revision-v1', '', '', '2014-02-21 08:56:16', '2014-02-21 08:56:16', '', 143, 'http://q-group.shahumyanmedia.com/143-revision-v1/', 0, 'revision', '', 0),
