(194, 1, '2014-02-21 09:02:03', '2014-02-21 09:02:03', '<p style="margin-bottom:30px;">Уважаемые коллеги,</p>\r\n<p>Часты случаи, когда работники компаний, исходя из служебной необходимости либо при переводе на другую должность, не владеют иностранными языками или навыками работы на компьютере в достаточной степени.</p>\r\n<p style="margin-top:15px;">Для решения подобных задач учебный центр «Q» предлагает курсы иностранных языков и компьютерные курсы.</p>\r\n<p style="margin-top:15px;">У нас преподают высококвалифицированные преподаватели, имеющие многолетний стаж работы.</p>\r\n<p style="margin-top:15px;">Занятия проводятся как в обустроенной комфортабельной аудитории центра, так и, в случае желания, на территории компании клиента. По выбору клиента, занятия могут быть групповыми и индивидуальными.</p>\r\n<p style="margin-top:15px;">Помимо организаций, в число наших клиентов входят и частные лица.</p>\r\n<p style="margin-top:15px;"><span style="font-weight:bold;">Иностранные языки</span></p>\r\n<p style="margin-top:15px;">Английский (все уровни, ускоренный курс, разговорный курс)</p>\r\n<p >Французский</p>\r\n<p >Немецкий</p>\r\n<p >Испанский</p>\r\n<p >Итальянский</p>\r\n<p >Русский </p>\r\n<p style="margin-top:15px;"><span style="font-weight:bold;">Компьютерные курсы</span></p>\r\n<p style="margin-top:15px;">Для начинаюних (элементарные навыки, Word, Excel, Outlook и т.д.) - 2 месяца</p>\r\n<p style="margin-top:15px;">Дизайнерские программы - Adobe Photoshop, Adobe Illustrator, Adobe InDesign, CorelDraw, 3DStudio Max, Macromedia Flash, Adobe Premier Pro, Adobe After Effect</p>\r\n<p style="margin-top:15px;">Курсы программирования - C++для начинающих, C++, C# + .Net, PHP+My SQL, HTML+ Java Script + CSS, MS SQL, Objective C</p>\r\n<p style="margin-top:30px;">Операционные системы Windows и построенные на их основе серверные системы (Active Directory, DNS, DHCP, RRAS, TS, VPN, Fileserver и др.) - 3,5 месяца</p>\r\n<p style="margin-top:15px;">Операционные системы Linux и построенные на их основе серверные системы (NTP,TFTP, FTP, SELinux, GPG и др. ) – 5 месяцев/p>', 'Учебный Центр', '', 'inherit', 'open', 'open', '', '143-revision-v1', '', '', '2014-02-21 09:02:03', '2014-02-21 09:02:03', '', 143, 'http://q-group.shahumyanmedia.com/143-revision-v1/', 0, 'revision', '', 0),
