x и построенные на их основе серверные системы (NTP,TFTP, FTP, SELinux, GPG и др. ) – 5 месяцев</p>', 'Учебный Центр', '', 'inherit', 'open', 'open', '', '143-revision-v1', '', '', '2014-02-21 09:02:17', '2014-02-21 09:02:17', '', 143, 'http://q-group.shahumyanmedia.com/143-revision-v1/', 0, 'revision', '', 0),
(197, 1, '2014-02-21 09:13:21', '2014-02-21 09:13:21', '<p>Уважаемые коллеги,</p>\r\n<p style="margin-top:30px;">Вы хотите, чтобы в Вашей компании было качественное компьютерное обслуживание, но не хотите платить лишние суммы компьютерному специалисту? Тогда предлагаемое нашей компанией абонентское компьютерное обслуживание - это то, что Вам нужно.\r\nПредалагаемая нами услуга намного дешевле, чем содержание штатной единицы сотрудника IT. Все работы по компьютерному обслуживанию выполняются по договору.</p>\r\n<p style="margin-top:20px;">Наши клиенты</p>\r\n<p >Нашими основными клиентами являются средние и малые офисы, предприятия, имеющие филиалы в городе Ереване и по всей республике, такие, как сети магазинов одежды, продуктов питания, стройматериалов и др., медицинские учреждения, развлекательные комплексы.</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Наладка и обслуживание локальной сети</a>\r\n<p >Мы осуществляем наладку локальной компьютерной сети как посредством кабелей, так и на воздушной основе, подсоединение к интернету, модернизацию уже имеющейся сети, консультирование по улучшению локальной сети, диагностику нарушений.</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Компьютерное обслуживание</a>\r\n<p >Осуществляем ремонт компьютеров, переинсталляцию операционной системы с сохранением всех данных, восстановление потерянной информации, замену деталей, модернизация компьютера, диагностику испорченных компонентов, дальнейшее обслуживание компьютеров, а также ИТ услуг на весь день.</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Внедрение и обслуживание серверных систем/a>\r\n<p >Предлагаем полный список услуг по обслуживанию серверов Вашей компании: установка доменной сети, наладка почтовых серверов и защита от спама, организация резервного копирования данных, надежности и безопасности работы серверов.</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Установка и обслуживание системы цифрового видеонаблюдения</a>\r\n<p >Предлагаем оборудование c профессиональной консультацией, исходя из соотношения цена/качество. Осуществляем установку, наладку и дальнейшее обслуживание системы видеонаблюдения (видеокамер и компьютеров видеозаписи).</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Организация безопасности электронной информации</a>\r\n<p >Во многих компаниях на сегодняшний день не осуществлены мероприятия по потере информации, предотвращению умышленного либо случайного уничтожения файлов. Мы решаем и эти вопросы посредством установки мощной и защищенной компьютерной сети.\r\nТаким образом, преимуществами работы с нами являются высокое качество и доступность оказываемых услуг, оперативность, отсутствие зависимости от одного работника, индивидуальный подход к каждому клиенту, своевременное и качественное обслуживания Ваших компьютеров.</p>\r\n<a style="margin-top:20px;float: right;">Благодарим за сотрудничество,</a><br/>\r\n<p style="margin-top:53px;text-align: right;margin-bottom: 28px;"><b>Группа Q-IT</b></p>', 'Аутсорсинг ИТ', '', 'inherit', 'open', 'open', '', '145-revision-v1', '', '', '2014-02-21 09:13:21', '2014-02-21 09:13:21', '', 145, 'http://q-group.shahumyanmedia.com/145-revision-v1/', 0, 'revision', '', 0),
