зопасности работы серверов.</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Установка и обслуживание системы цифрового видеонаблюдения</a>\r\n<p >Предлагаем оборудование c профессиональной консультацией, исходя из соотношения цена/качество. Осуществляем установку, наладку и дальнейшее обслуживание системы видеонаблюдения (видеокамер и компьютеров видеозаписи).</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Организация безопасности электронной информации</a>\r\n<p >Во многих компаниях на сегодняшний день не осуществлены мероприятия по потере информации, предотвращению умышленного либо случайного уничтожения файлов. Мы решаем и эти вопросы посредством установки мощной и защищенной компьютерной сети.\r\nТаким образом, преимуществами работы с нами являются высокое качество и доступность оказываемых услуг, оперативность, отсутствие зависимости от одного работника, индивидуальный подход к каждому клиенту, своевременное и качественное обслуживания Ваших компьютеров.</p>\r\n<a style="margin-top:20px;float: right;">Благодарим за сотрудничество,</a><br/>\r\n<p style="margin-top:53px;text-align: right;margin-bottom: 28px;"><b>Группа Q-IT</b></p>', 'Аутсорсинг ИТ', '', 'inherit', 'open', 'open', '', '145-revision-v1', '', '', '2014-02-21 09:15:46', '2014-02-21 09:15:46', '', 145, 'http://q-group.shahumyanmedia.com/145-revision-v1/', 0, 'revision', '', 0),
