(211, 1, '2014-02-21 09:22:15', '2014-02-21 09:22:15', '<p style="margin-top:20px;">Уважаемые коллеги,</p>\r\n<p style="margin-top:30px;">Вы хотите, чтобы в Вашей компании было качественное компьютерное обслуживание, но не хотите платить лишние суммы компьютерному специалисту? Тогда предлагаемое нашей компанией абонентское компьютерное обслуживание - это то, что Вам нужно.</p>\r\n<p style="margin-top:15px;">Предалагаемая нами услуга намного дешевле, чем содержание штатной единицы сотрудника IT. Все работы по компьютерному обслуживанию выполняются по договору.</p>\r\n<a style="margin-top:70px;font-weight:bold;float: left;width: 100%;">Наши клиенты</a>\r\n<p style="margin-top:15px;float:left;">Нашими основными клиентами являются средние и малые офисы, предприятия, имеющие филиалы в городе Ереване и по всей республике, такие, как сети магазинов одежды, продуктов питания, стройматериалов и др., медицинские учреждения, развлекательные комплексы.</p>\r\n<a style="margin-top:70px;font-weight:bold;float: left;width: 100%;">Наладка и обслуживание локальной сети</a>\r\n<p style="margin-top:15px;float:left;">Мы осуществляем наладку локальной компьютерной сети как посредством кабелей, так и на воздушной основе, подсоединение к интернету, модернизацию уже имеющейся сети, консультирование по улучшению локальной сети, диагностику нарушений.</p>\r\n<a style="margin-top:70px;font-weight:bold;float: left;width: 100%;">Компьютерное обслуживание</a>\r\n<p style="margin-top:15px;float:left;">Осуществляем ремонт компьютеров, переинсталляцию операционной системы с сохранением всех данных, восстановление потерянной информации, замену деталей, модернизация компьютера, диагностику испорченных компонентов, дальнейшее обслуживание компьютеров, а также ИТ услуг на весь день.</p>\r\n<a style="margin-top:70px;font-weight:bold;float: left;width: 100%;">Внедрение и обслуживание серверных систем</a>\r\n<p style="margin-top:15px;float:left;">Предлагаем полный список услуг по обслуживанию серверов Ваш