(242, 1, '2014-02-23 17:46:23', '2014-02-23 17:46:23', '<strong>Q-TC</strong>\n<p style="margin-top:10px;margin-bottom:10px;">Учебный центр - престижный учебный центр, где вы всегда получите качественные знания, индивидуальный подход и гарантию инвестиций в обучение. курсы в Учебном центре Q-TC - залог вашего успеха на рынке труда. В учебном центре проводится подготовка и повышение квалификации специалистов более чем по 50 уникальным комплексным и тренинговым курсам.</p>\n<strong style="margin-top:10px;">Q-IT</strong>\n<p style="margin-top:10px;margin-bottom:10px;">Компания Q-IT более 5 лет работает на рынке профессиональных IT услуг. Мы предлагаем Вам комплексное системное администрирование сетей, ИТ консалтинг, абонентское обслуживание ПК, обслуживание компьютерной техники, высококачественную IT поддержку пользователей на базе лучших мировых стандартов и методологий, а также полный комплекс IT услуг на основе схемы IT аутсорсинга.</p>\n<strong style="margin-top:10px;">Почему Q-IT:</strong>\n<p style="margin-top:10px;margin-bottom:10px;margin-left: 40px;">Более 5-и лет успешной работы на рынке IT услуг\nТолько положительные отзывы и рекомендации клиентов\nВысокие стандарты контроля качества\n24/7/365</p>\n<p style="margin-top:10px;margin-bottom:45px;">Аутсорсинг (от англ. outsourcing: внешний источник) - передача организацией определённых бизнес-процессов или производственных функций на обслуживание другой компании, специализирующейся в соответствующей области.</p>', 'О нас', '', 'inherit', 'open', 'open', '', '155-autosave-v1', '', '', '2014-02-23 17:46:23', '2014-02-23 17:46:23', '', 155, 'http://q-group.shahumyanmedia.com/155-autosave-v1/', 0, 'revision', '', 0),
