(253, 1, '2014-02-23 18:03:28', '2014-02-23 18:03:28', 'Q-IT\r\n<p style="margin-top: 15px;">Компания Q-IT более 6 лет работает на рынке профессиональных IT услуг. Мы предлагаем Вам комплексное системное администрирование сетей, ИТ консалтинг, абонентское обслуживание ПК, обслуживание компьютерной техники, высококачественную IT поддержку пользователей на базе лучших мировых стандартов и методологий, а также полный комплекс IT услуг на основе схемы IT аутсорсинга.</p>\r\n<p style="margin-top: 15px;">Почему Q-IT:</p>\r\n<p style="margin-top: 15px; margin-left: 35px;">· Более 6-и лет успешной работы на рынке IT услуг\r\n· Только положительные отзывы и рекомендации клиентов\r\n· Высокие стандарты контроля качества\r\n. 24/7/365</p>\r\n<p style="margin-top: 15px;">Аутсорсинг (от англ. outsourcing: внешний источник) - передача организацией определённых бизнес-процессов или производственных функций на обслуживание другой компании, специализирующейся в соответствующей области.</p>', 'Аутсорсинг ИТ', '', 'publish', 'closed', 'closed', '', '%d0%b0%d1%83%d1%82%d1%81%d0%be%d1%80%d1%81%d0%b8%d0%bd%d0%b3-%d0%b8%d1%82', '', '', '2015-01-16 07:38:12', '2015-01-16 07:38:12', '', 139, 'http://q-group.shahumyanmedia.com/?page_id=253', 12, 'page', '', 0),
