(259, 1, '2014-02-23 18:12:15', '2014-02-23 18:12:15', '<p>Q-TC</p>\n<p style="margin-top: 15px;">Company Q-IT has been working in the market of professional IT Services for more than 5 years of experience. We offer you a comprehensive system administration of networks, IT consulting, PC subscription service, maintenance of computer equipment, high-quality IT support to the users based on the best international standards and methodologies, as well as a full range of IT services based on the schema of IT outsourcing.</p>\n<p style="margin-top: 15px;">Why Q-IT?</p>\n<p style="margin-top: 15px;margin-left:35px;">More than 5 years of successful work in the IT services market\nOnly positive reviews and recommendations of the customers\nHigh standards of quality control\n24/7/365</p>\n<p style="margin-top: 15px;">Outsourcing (from English-outsourcing: external source)-to send the organization of certain business processes or business functions to serve other company, specializing in the corresponding field.</p>', 'Training Center', '', 'inherit', 'open', 'open', '', '256-autosave-v1', '', '', '2014-02-23 18:12:15', '2014-02-23 18:12:15', '', 256, 'http://q-group.shahumyanmedia.com/256-autosave-v1/', 0, 'revision', '', 0),
(260, 1, '2014-02-23 18:12:30', '2014-02-23 18:12:30', '<p>Q-TC</p>\r\n<p style="margin-top: 25px;">Training Center Q-TC is a prestigious training center where you will always get high-quality knowledge, individual approach and guarantee invenstments in training. Training Center Q-TC is your success in the labor market. In the Training Center Q-TC the training and the increacing qualification of specialists are conducted with more than 50 unique and comprehensive training courses.</p>', 'Training Center', '', 'inherit', 'open', 'open', '', '256-revision-v1', '', '', '2014-02-23 18:12:30', '2014-02-23 18:12:30', '', 256, 'http://q-group.shahumyanmedia.com/256-revision-v1/', 0, 'revision', '', 0),
(261, 1, '2014-02-23 18:14:04', '2014-02-23 18:14:04', '<b>Кабельные системы\r\n</b>Кабельная система объединяет локальную компьютерную сеть и телефонные сети, систему безопасности и т.п. Компания Q Group предлагает услуги по установке и обслуживанию как целостной системы, так и ее отдельных компонентов.\r\n\r\n&nbsp;\r\n\r\n<b>Предпроектное исследование\r\n</b>Мы осуществляем проверку технического состояния и качества кабельных систем, определение категории планируемой кабельной системы, сроков работ, планирование бюджета.\r\n\r\n<b>Проектирование</b>\r\n\r\n<b>\r\n</b>Проектирование осуществляется нашими опытными специалистами на основании всей собранной информации и при взаимодействии с заказчиком.\r\n\r\n&nbsp;\r\n\r\n<b>Выполнение проекта\r\n</b>На основании уже имеющегося проектного документа с применением необходимых устройств и материалов осуществляется проводка кабелей (проверка качества – Fluke Test), установка оборудования.\r\n\r\n&nbsp;\r\n\r\n<b>Системы цифрового </b><b>видео</b><b>наблюдения\r\n</b>Компания Q Group выполняет установку, наладку (видеозапись, аудиозапись, возможность online  наблюдения) обеспечивающих безопасность IP видеокамер, DVR (цифровых видеорегистраторов).\r\n\r\n&nbsp;\r\n\r\n<b>АТС (Автоматическая телефонная станция)\r\n</b>Мы предлагаем услуги по проведению сетей телефонных систем (кабелизация).', 'Интегратор ИТ', '', 'publish', 'closed', 'closed', '', '%d0%b8%d0%bd%d1%82%d0%b5%d0%b3%d1%80%d0%b0%d1%82%d0%be%d1%80_%d0%b8%d1%82', '', '', '2014-05-27 12:41:57', '2014-05-27 12:41:57', '', 139, 'http://q-group.shahumyanmedia.com/?page_id=261', 9, 'page', '', 0),
(262, 1, '2014-02-23 18:14:04', '2014-02-23 18:14:04', '<p>Q-TC</p>\r\n<p style="margin-top: 25px;">Учебный центр - престижный учебный центр, где вы всегда получите качественные знания, индивидуальный подход и гарантию инвестиций в обучение. курсы в Учебном центре Q-TC - залог вашего успеха на рынке труда. В учебном центре проводится подготовка и повышение квалификации специалистов более чем по 50 уникальным комплексным и тренинговым курсам.</p>', 'Учебный Центр', '', 'inherit', 'open', 'open', '', '261-revision-v1', '', '', '2014-02-23 18:14:04', '2014-02-23 18:14:04', '', 261, 'http://q-group.shahumyanmedia.com/261-revision-v1/', 0, 'revision', '', 0),
(263, 1, '2014-02-23 18:14:51', '2014-02-23 18:14:51', '&nbsp;\r\n\r\n<b>Մալուխային համակարգեր.</b>\r\n\r\n<b>\r\n</b>Մալուխային համակարգը միավորում է լոկալ համակարգչային ցանցը և հեռախոսային ցանցերը, անվտանգության համակարգերը և այլն։  Q Group ընկերությունն առաջարկում է ինչպես ամբողջական, այնպես էլ առանձին բաղադրիչների տեղադրման ու սպասարկման ծառայություններ։\r\n\r\n<b> </b>\r\n\r\n<b>Նախագծումից առաջ կատարվող հետազոտություն։</b> Իրականացնում ենք մալուխային համակարգերի տեխնիկական վիճակի և որակի  ստուգում, պլանավորվող մալուխային ցանցի կատեգորիայի որոշում, ժամկետների  նշանակում, բյուջեի պլանավորում։\r\n\r\n<b> </b>\r\n\r\n<b>Նախագծում։</b>  Հավաքագրված ողջ ինֆորմացիայի հիման վրա նախագծումն իրականացնում ենք մեր փորձառու մասնագետների կողմից պատվիրատուի հետ փոխադարձ համաձայնությամբ։\r\n\r\n<b> </b>\r\n\r\n<b>Նախագծի իրականացում։</b> Արդեն առկա նախագծային փաստաթղթի հիման վրա՝ օգտագործելով  անհրաժեշտ սարքեր և սարքավորումներ, իրականացվում են մալուխների անցկացում /որակի ստուգում՝ Fluke Test/, սարքերի տեղադրում։\r\n\r\n<b> </b>\r\n\r\n<b>Թվային դիտման համակարգեր</b>\r\n\r\nQ Group-ն իրականացնում է անվտանգությունն ապահովվող IP տեսախցիկների, DVR-ների  տեղադրում, կարգավորում /տեսագրություն, ձայնագրություն, online դիտման հնարավորություն/\r\n\r\n&nbsp;\r\n\r\n<b>ATS / ԱՀԿ  /Ավտոմատ հեռախոսային կայան/</b>\r\n\r\nՀեռախոսային համակարգի ցանցի անցկացում /Cabeling/\r\n<p style="text-align: right;"></p>', 'ՏՏ Ինտեգրատոր', '', 'publish', 'closed', 'closed', '', '%d5%bf%d5%bf_%d5%ab%d5%b6%d5%bf%d5%a5%d5%a3%d6%80%d5%a1%d5%bf%d5%b8%d6%80-2', '', '', '2014-05-27 12:42:22', '2014-05-27 12:42:22', '', 0, 'http://q-group.shahumyanmedia.com/?page_id=263', 9, 'page', '', 0),
(264, 1, '2014-02-23 18:14:51', '2014-02-23 18:14:51', '<p>Q-TC</p>\r\n<p style="margin-top: 25px;">ուսումնական կենտրոնը հեղինակավոր կենտրոն է, որտեղ դուք միշտ կստանաք բարձրորակ գիտելիքներ, անհատական մոտեցում և ուսումնառության ներդևումների երաշխիք: Q-TC ուսումնական կենտրոնում ստացած դասընթացները Ձեր հաջողության գրավականն են աշխատանքային շուկայում: Ուսումնական կենտրոնում անցկացվում է մասնագետների վերապատրաստում և որակավորման աճ` ավելի քան 50 եզակի և ամբողջական վերապատրաստման դասընթացներով:</p>', 'Ուսումնական կենտրոն', '', 'inherit', 'open', 'open', '', '263-revision-v1', '', '', '2014-02-23 18:14:51', '2014-02-23 18:14:51', '', 263, 'http://q-group.shahumyanmedia.com/263-revision-v1/', 0, 'revision', '', 0),
