(409, 1, '2014-02-25 08:55:13', '2014-02-25 08:55:13', '<p>Q-IT</p>\r\n<p style="margin-top: 15px;">Q-IT Ընկերությունը գործում է IT պրոֆեսիոնալ ծառայությունների շուկայում ավելի քան 5 տարի: Մենք առաջարկում ենք Ձեզ ցանցերի ամբողջական համակարգող կառավարում, խորհրդատվություն, ԱՀ բաժանորդագրային ծառայություն, տեխնիկական սպասարկում, բարձրորակ աջակցություն օգտվողներին, որը հիմնված է միջազգային լավագույն ստանդարտների և մեթոդիկայի վրա, ինչպես նաև IT ծառայությունների լիարժեք կոմպլեքս` հիմնված աութսոուրսինգի սխեմայի վրա:</p>\r\n<p style="margin-top: 15px;">Ինչու Q-IT</p>\r\n<p style="margin-top: 15px;margin-left:35px;">Ավելի քան 5 տարի հաջողությամբ աշխատում է IT ծառայությունների շուկայում\r\nՄիայն դրական արձագանքներ և հաճախորդների նախապատվություն\r\nՈրակի վերահսկման բարձր չափանիշներ\r\n24/7/365</p>\r\n<p style="margin-top: 15px;">Աութսոուրսինգ (անգլ. outsourcing: արտաքին աղբյուր)-փոխանցում է կազմակերպության կոնկրետ բիզնես գործընթացի կամ մեկ այլ կազմակերպության բիզնես գործառույթների ծառայությունը` մասնագիտացված համապատասխան ոլորտում:</p>', 'ՏՏ Աութսորսինգ', '', 'inherit', 'open', 'open', '', '251-revision-v1', '', '', '2014-02-25 08:55:13', '2014-02-25 08:55:13', '', 251, 'http://q-group.shahumyanmedia.com/251-revision-v1/', 0, 'revision', '', 0),
(410, 1, '2014-02-25 08:55:42', '2014-02-25 08:55:42', '<p>Հարգելի գործընկեր,</p>\r\n<p style="margin-top:30px;">Դուք ցանկանում եք ունենալ համակարգչային որակյալ սպասարկում Ձեր կազմակերպությունում, բայց չեք ցանկանում ավելորդ գումար վճարել համակարգչային մասնագետին, ապա մեր կազմակերպության կողմից առաջարկվող աբոնենտային համակարգչային սպասարկումը հենց այն է, ինչ Ձեզ պետք է:Մեր կողմից մատուցվող ծառայությունը շատ ավելի մատչելի է, քան հաստիքում համակարգչային մասնագետ ունենալը: Համակարգչային սպասարկման բոլոր աշխատանքները կատարվում են պայմանագրով:</p>\r\n<p style="margin-top:20px;">Մեր պատվիրատուները</p>\r\n<p >Մեր հիմնական պատվիրատուներն են ողջ հանրապետությունում և Երևան քաղաքում ստորաբաժանումներ ունեցող կազմակերպությունները, փոքր և միջին գրասենյակները, Օրինակ`հագուստի, օծանելիքի, շինանյութի, սննդի և այլ ոլորտի խանութներ կամ ձեռնարկություններ:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Լոկալ ցանցի կարգավորում</a>\r\n<p >Իրականացնում ենք Ձեր կազմակերպության լոկալ համակարգչային ցանցի կարգավորում ինչպես մալուխային, այնպես էլ օդային հիմքի վրա, ինտերնետին միանալու կարգավորում, առկա ցանցի արդիականացում, լոկալ ցանցի բարելավման խորհրդհատվություն, խափանումների դիագնոստիկա:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Համակարգչային սպասարկում</a>\r\n<p >Կատարում ենք համակարգչային վերանորոգում, օպերացիոն համակարգի վերատեղադրում բոլոր տվյալների պահպանմամբ, ջնջված ինֆորմացիայի վերականգնում, մասերի փոխարինում, համակարգի արդիականացում, խափանված կոմպոնենտների դիագնոստիկա, համակարգիչների հետագա սպասարկում, ինչպես նաև տեղեկատվական տեխնոլոգիաների շուրջօրյա սպասարկում:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Սերվերային համակարգերի ներդնում և սպասարկում</a>\r\n<p >Առաջարկում ենք Ձեր կազմակերպության սերվերների սպասարկման ամբողջական ծառայությունների ցանկ. դոմենային ցանցի ներդնում, փոստային սերվերների կարգավորում և պաշտպանություն սպամից, տվյալների ռեզերվային պատճենահանման կազմակերպում, սերվերների աշխատանքի հուսալիության և անվտանգության կազմակերպում:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Թվային դիտման համակարգերի ներդնում և սպասարկում</a>\r\n<p >Ներկայացնում ենք սարքավորումների առաջարկներ մասնագիտական խորհրդատվությամբ` ելնելով գին/որակ պարամետրից: Իրականացնում ենք տեսադիտման համակարգի (տեսախցիկների և տեսաձայնագրման համակարգիրների) տեղադրում, կարգավորում և հետագա սպսարկում:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Ապրանքի շարժի և վաճառքի կետերի ծրագրեր</a>\r\n<p >Մենք համագործակցում ենք տարբեր կազմակերպությունների հետ, որոնք մասնագիտացված են առևտրի, սննդի և այլ ոլորտի կազմակերպությունների ապրանքային պահեստների ներքին շարժի, վաճառքի կետերի կազմակերպման մեկ ընդհանուր համակարգչային ծրագրի ստեղծմամբ և ներդրմամբ: Տվյալ ծրագրի շնորհիվ հնարավորություն է տրվում վերահսկել ողջ առևտրային ապրանքի շարժը և վաճառքը ժամանակի ցանկացած պահին:\r\nԱյսօր բազմաթիվ կազմակերպություններում գործում են վերը նշված նման գործողություններ իրականացնող ծրագրեր, բայց շատ դեպքերում լուծված չեն տվյալների բազաների ռեզերվային արխիվացման և ողջ ծրագրային համակարգի անխափան և անվտանգ աշխատանքի հարցերը:</p>\r\n<a style="margin-top:20px;font-weight:bold;float: left;width: 100%;">Էլեկտրոնային ինֆորմացիայի անվտանգության կազմակերպում</a>\r\n<p >Բազմաթիվ կազմկերպություններում իրականացված չեն էլեկտրոնային ինֆորնացիայի կորուստների, աշխատակիցների կողմից ֆայլերի պատահական կամ դիտավորյալ ջնջման կանխման միջոցառումներ: Մենք լուծում ենք նաև այդ խնդիրները հզոր և պաշտպանված համակարգչային ցանց կառուցելու շնորհիվ:\r\nԱյսպիսով, մեզ հետ աշխատելու առավելություններն են բարձր օպերատիվությունը, ծառայությունների բարձր որակը, ծառայությունների մատուցման մատչելիությունը, մեկ աշխատակցից կախվածություն չունենալը, յուրաքանչյուր պատվիրատուի հանդեպ անհատական մոտեցում ցուցաբերելը, համակարգչային խնդիրների ժամանակին և որակյալ սպասարկումը:</p>\r\n<a style="margin-top:20px;float: left;width: 100%;">Ուրախ կլինենք համագործակցել:</a>\r\n<a style="margin-top:20px;float: right;">Շնորհակալություն մեր ծառայություններից օգտվելու համար:</a><br/>\r\n<p style="margin-top:53px;text-align: right;margin-bottom: 28px;"><b>"Q" IT</b> խումբ:</p>', 'ՏՏ Աութսորսինգ', '', 'inherit', 'open', 'open', '', '110-revision-v1', '', '', '2014-02-25 08:55:42', '2014-02-25 08:55:42', '', 110, 'http://q-group.shahumyanmedia.com/110-revision-v1/', 0, 'revision', '', 0),
(411, 1, '2014-02-25 08:56:48', '2014-02-25 08:56:48', '<p>Q-IT</p>\r\n<p style="margin-top: 15px;">Компания Q-IT более 5 лет работает на рынке профессиональных IT услуг. Мы предлагаем Вам комплексное системное администрирование сетей, ИТ консалтинг, абонентское обслуживание ПК, обслуживание компьютерной техники, высококачественную IT поддержку пользователей на базе лучших мировых стандартов и методологий, а также полный комплекс IT услуг на основе схемы IT аутсорсинга.</p>\r\n<p style="margin-top: 15px;">Почему Q-IT:</p>\r\n<p style="margin-top: 15px;margin-left:35px;">· Более 5-и лет успешной работы на рынке IT услуг\r\n· Только положительные отзывы и рекомендации клиентов\r\n· Высокие стандарты контроля качества \r\n. 24/7/365</p>\r\n<p style="margin-top: 15px;">Аутсорсинг (от англ. outsourcing: внешний источник) - передача организацией определённых бизнес-процессов или производственных функций на обслуживание другой компании, специализирующейся в соответствующей области.</p>', 'Аутсорсинг ИТ', '', 'inherit', 'open', 'open', '', '253-revision-v1', '', '', '2014-02-25 08:56:48', '2014-02-25 08:56:48', '', 253, 'http://q-group.shahumyanmedia.com/253-revision-v1/', 0, 'revision', '', 0),
