(553, 1, '2014-04-08 05:35:17', '2014-04-08 05:35:17', '<strong>Q-IT</strong>\r\n\r\nCompany Q-IT has been working in the market of professional IT Services for more than 5 years of experience. We offer you a complete system of network management, IT consulting, PC subscription service, maintenance service, high-quality IT support to users which is based on the international best standards and methods as well as full complex of IT services based on the IT outsourcing scheme.\r\n\r\n<strong style="line-height: 1.5em;">Q-TC</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px;">"Q" Training Center is a prestigious training center where you will always receive high quality knowledge, individual approach and the guarantee of investments in training. Training courses at ‘''Q'''' Training Center are the guarantee to your success in the job market. At ‘''Q'''' Training Center the training of specialists and increasing of qualification are conducted with more than 50 unique and full training courses.</p>\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Why Q-IT?</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">More than 5 years of successful work in the IT services market\r\nOnly positive responses and customers'' preference\r\nHigh standards of quality control\r\n24/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Outsourcing (from English-outsourcing: external source) transfers the service of the organization''s specific business process or another organization''s business functions specialized in the appropriate field.</p>', 'About us', '', 'inherit', 'open', 'open', '', '24-revision-v1', '', '', '2014-04-08 05:35:17', '2014-04-08 05:35:17', '', 24, 'http://q-group.am/24-revision-v1/', 0, 'revision', '', 0),
(554, 1, '2014-04-08 05:35:38', '2014-04-08 05:35:38', '<strong>Q-IT</strong>\r\n\r\nQ-IT Ընկերությունը գործում է IT պրոֆեսիոնալ ծառայությունների շուկայում ավելի քան 5 տարի: Մենք առաջարկում ենք Ձեզ ցանցերի ամբողջական համակարգող կառավարում, խորհրդատվություն, ԱՀ բաժանորդագրային ծառայություն, տեխնիկական սպասարկում, բարձրորակ աջակցություն օգտվողներին, որը հիմնված է միջազգային լավագույն ստանդարտների և մեթոդիկայի վրա, ինչպես նաև IT ծառայությունների լիարժեք կոմպլեքս` հիմնված աութսոուրսինգի սխեմայի վրա:\r\n\r\n<strong>Q-TC</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px;">TC ոսումնական կենտրոնը հեղինակավոր կենտրոն է, որտեղ դուք միշտ կստանաք բարձրորակ գիտելիքներ, անհատական մոտեցում և ուսումնառության ներդրումների երաշխիք: Q-TC ուսումնական կենտրոնում ստացած դասընթացները Ձեր հաջողության գրավականն են աշխատանքային շուկայում: Ուսումնական կենտրոնում անցկացվում է մասնագետների վերապատրաստում և որակավորման աճ` ավելի քան 50 եզակի և ամբողջական վերապատրաստման դասընթացներով:</p>\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Ինչու Q-IT</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">Ավելի քան 5 տարի հաջողությամբ աշխատում է IT ծառայությունների շուկայում\r\nՄիայն դրական արձագանքներ և հաճախորդների նախապատվություն\r\nՈրակի վերահսկման բարձր չափանիշներ\r\n4/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Աութսոուրսինգ (անգլ. outsourcing: արտաքին աղբյուր)-փոխանցում է կազմակերպության կոնկրետ բիզնես գործընթացի կամ մեկ այլ կազմակերպության բիզնես գործառույթների ծառայությունը` մասնագիտացված համապատասխան ոլորտում:</p>', 'Մեր մասին', '', 'inherit', 'open', 'open', '', '108-revision-v1', '', '', '2014-04-08 05:35:38', '2014-04-08 05:35:38', '', 108, 'http://q-group.am/108-revision-v1/', 0, 'revision', '', 0),
(555, 1, '2014-04-08 05:36:00', '2014-04-08 05:36:00', '<strong>Q-IT</strong>\r\n\r\nКомпания Q-IT более 5 лет работает на рынке профессиональных IT услуг. Мы предлагаем Вам комплексное системное администрирование сетей, ИТ консалтинг, абонентское обслуживание ПК, обслуживание компьютерной техники, высококачественную IT поддержку пользователей на базе лучших мировых стандартов и методологий, а также полный комплекс IT услуг на основе схемы IT аутсорсинга.\r\n\r\n&nbsp;\r\n\r\n<strong>Q-TC</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px;">Учебный центр - престижный учебный центр, где вы всегда получите качественные знания, индивидуальный подход и гарантию инвестиций в обучение. курсы в Учебном центре Q-TC - залог вашего успеха на рынке труда. В учебном центре проводится подготовка и повышение квалификации специалистов более чем по 50 уникальным комплексным и тренинговым курсам.</p>\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Почему Q-IT:</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">Более 5-и лет успешной работы на рынке IT услуг\r\nТолько положительные отзывы и рекомендации клиентов\r\nВысокие стандарты контроля качества\r\n24/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Аутсорсинг (от англ. outsourcing: внешний источник) - передача организацией определённых бизнес-процессов или производственных функций на обслуживание другой компании, специализирующейся в соответствующей области.</p>', 'О нас', '', 'inherit', 'open', 'open', '', '155-revision-v1', '', '', '2014-04-08 05:36:00', '2014-04-08 05:36:00', '', 155, 'http://q-group.am/155-revision-v1/', 0, 'revision', '', 0),
