(612, 1, '2014-04-25 10:03:41', '2014-04-25 10:03:41', 'Հարգելի գործընկեր,\r\n<p style="margin-top: 30px;">Դուք ցանկանում եք ունենալ համակարգչային որակյալ սպասարկում Ձեր կազմակերպությունում, բայց չեք ցանկանում ավելորդ գումար վճարել համակարգչային մասնագետին, ապա մեր կազմակերպության կողմից առաջարկվող աբոնենտային համակարգչային սպասարկումը հենց այն է, ինչ Ձեզ պետք է:Մեր կողմից մատուցվող ծառայությունը շատ ավելի մատչելի է, քան հաստիքում համակարգչային մասնագետ ունենալը: Համակարգչային սպասարկման բոլոր աշխատանքները կատարվում են պայմանագրով:</p>\r\n<p style="margin-top: 20px;">Մեր պատվիրատուները</p>\r\nՄեր հիմնական պատվիրատուներն են ողջ հանրապետությունում և Երևան քաղաքում ստորաբաժանումներ ունեցող կազմակերպությունները, փոքր և միջին գրասենյակները, Օրինակ`հագուստի, օծանելիքի, շինանյութի, սննդի և այլ ոլորտի խանութներ կամ ձեռնարկություններ:\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Լոկալ ցանցի կարգավորում</a>\r\n\r\nԻրականացնում ենք Ձեր կազմակերպության լոկալ համակարգչային ցանցի կարգավորում ինչպես մալուխային, այնպես էլ օդային հիմքի վրա, ինտերնետին միանալու կարգավորում, առկա ցանցի արդիականացում, լոկալ ցանցի բարելավման խորհրդհատվություն, խափանումների դիագնոստիկա:\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Համակարգչային սպասարկում</a>\r\n\r\nԿատարում ենք համակարգչային վերանորոգում, օպերացիոն համակարգի վերատեղադրում բոլոր տվյալների պահպանմամբ, ջնջված ինֆորմացիայի վերականգնում, մասերի փոխարինում, համակարգի արդիականացում, խափանված կոմպոնենտների դիագնոստիկա, համակարգիչների հետագա սպասարկում, ինչպես նաև տեղեկատվական տեխնոլոգիաների շուրջօրյա սպասարկում:\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Սերվերային համակարգերի ներդնում և սպասարկում</a>\r\n\r\nԱռաջարկում ենք Ձեր կազմակերպության սերվերների սպասարկման ամբողջական ծառայությունների ցանկ. դոմենային ցանցի ներդնում, փոստային սերվերների կարգավորում և պաշտպանություն սպամից, տվյալների ռեզերվային պատճենահանման կազմակերպում, սերվերների աշխատանքի հուսալիության և անվտանգության կազմակերպում:\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Թվային դիտման համակարգերի ներդնում և սպասարկում</a>\r\n\r\nՆերկայացնում ենք սարքավորումների առաջարկներ մասնագիտական խորհրդատվությամբ` ելնելով գին/որակ պարամետրից: Իրականացնում ենք տեսադիտման համակարգի (տեսախցիկների և տեսաձայնագրման համակարգիրների) տեղադրում, կարգավորում և հետագա սպսարկում:\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Ապրանքի շարժի և վաճառքի կետերի ծրագրեր</a>\r\n\r\nՄենք համագործակցում ենք տարբեր կազմակերպությունների հետ, որոնք մասնագիտացված են առևտրի, սննդի և այլ ոլորտի կազմակերպությունների ապրանքային պահեստների ներքին շարժի, վաճառքի կետերի կազմակերպման մեկ ընդհանուր համակարգչային ծրագրի ստեղծմամբ և ներդրմամբ: Տվյալ ծրագրի շնորհիվ հնարավորություն է տրվում վերահսկել ողջ առևտրային ապրանքի շարժը և վաճառքը ժամանակի ցանկացած պահին:\r\nԱյսօր բազմաթիվ կազմակերպություններում գործում են վերը նշված նման գործողություններ իրականացնող ծրագրեր, բայց շատ դեպքերում լուծված չեն տվյալների բազաների ռեզերվային արխիվացման և ողջ ծրագրային համակարգի անխափան և անվտանգ աշխատանքի հարցերը:\r\n\r\n<a style="margin-top: 20px; font-weight: bold; float: left; width: 100%;">Էլեկտրոնային ինֆորմացիայի անվտանգության կազմակերպում</a>\r\n\r\nԲազմաթիվ կազմկերպություններում իրականացված չեն էլեկտրոնային ինֆորնացիայի կորուստների, աշխատակիցների կողմից ֆայլերի պատահական կամ դիտավորյալ ջնջման կանխման միջոցառումներ: Մենք լուծում ենք նաև այդ խնդիրները հզոր և պաշտպանված համակարգչային ցանց կառուցելու շնորհիվ:\r\nԱյսպիսով, մեզ հետ աշխատելու առավելություններն են բարձր օպերատիվությունը, ծառայությունների բարձր որակը, ծառայությունների մատուցման մատչելիությունը, մեկ աշխատակցից կախվածություն չունենալը, յուրաքանչյուր պատվիրատուի հանդեպ անհատական մոտեցում ցուցաբերելը, համակարգչային խնդիրների ժամանակին և որակյալ սպասարկումը:\r\n\r\n<a style="margin-top: 20px; float: left; width: 100%;">Ուրախ կլինենք համագործակցել:</a>\r\n<a style="margin-top: 20px; float: right;">Շնորհակալություն մեր ծառայություններից օգտվելու համար:</a>\r\n<p style="margin-top: 53px; text-align: right; margin-bottom: 28px;"><b>"Q" IT</b> խումբ:</p>', 'ՏՏ Աութսորսինգ', '', 'inherit', 'open', 'open', '', '110-revision-v1', '', '', '2014-04-25 10:03:41', '2014-04-25 10:03:41', '', 110, 'http://q-group.am/110-revision-v1/', 0, 'revision', '', 0),
(613, 1, '2014-04-25 10:03:53', '2014-04-25 10:03:53', '<p style="margin-top: 20px;">Уважаемые коллеги,</p>\r\n<p style="margin-top: 30px;">Вы хотите, чтобы в Вашей компании было качественное компьютерное обслуживание, но не хотите платить лишние суммы компьютерному специалисту? Тогда предлагаемое нашей компанией абонентское компьютерное обслуживание - это то, что Вам нужно.</p>\r\n<p style="margin-top: 15px;">Предалагаемая нами услуга намного дешевле, чем содержание штатной единицы сотрудника IT. Все работы по компьютерному обслуживанию выполняются по договору.</p>\r\n<a style="margin-top: 70px; font-weight: bold; float: left; width: 100%;">Наши клиенты</a>\r\n<p style="margin-top: 15px; float: left;">Нашими основными клиентами являются средние и малые офисы, предприятия, имеющие филиалы в городе Ереване и по всей республике, такие, как сети магазинов одежды, продуктов питания, стройматериалов и др., медицинские учреждения, развлекательные комплексы.</p>\r\n<a style="margin-top: 70px; font-weight: bold; float: left; width: 100%;">Наладка и обслуживание локальной сети</a>\r\n<p style="margin-top: 15px; float: left;">Мы осуществляем наладку локальной компьютерной сети как посредством кабелей, так и на воздушной основе, подсоединение к интернету, модернизацию уже имеющейся сети, консультирование по улучшению локальной сети, диагностику нарушений.</p>\r\n<a style="margin-top: 70px; font-weight: bold; float: left; width: 100%;">Компьютерное обслуживание</a>\r\n<p style="margin-top: 15px; float: left;">Осуществляем ремонт компьютеров, переинсталляцию операционной системы с сохранением всех данных, восстановление потерянной информации, замену деталей, модернизация компьютера, диагностику испорченных компонентов, дальнейшее обслуживание компьютеров, а также ИТ услуг на весь день.</p>\r\n<a style="margin-top: 70px; font-weight: bold; float: left; width: 100%;">Внедрение и обслуживание серверных систем</a>\r\n<p style="margin-top: 15px; float: left;">Предлагаем полный список услуг по обслуживанию серверов Вашей компании: установка доменной сети, наладка почтовых серверов и защита от спама, организация резервного копирования данных, надежности и безопасности работы серверов.</p>\r\n<a style="margin-top: 70px; font-weight: bold; float: left; width: 100%;">Установка и обслуживание системы цифрового видеонаблюдения</a>\r\n<p style="margin-top: 15px; float: left;">Предлагаем оборудование c профессиональной консультацией, исходя из соотношения цена/качество. Осуществляем установку, наладку и дальнейшее обслуживание системы видеонаблюдения (видеокамер и компьютеров видеозаписи).</p>\r\n<a style="margin-top: 70px; font-weight: bold; float: left; width: 100%;">Организация безопасности электронной информации</a>\r\n<p style="margin-top: 15px; float: left; margin-bottom: 25px;">Во многих компаниях на сегодняшний день не осуществлены мероприятия по потере информации, предотвращению умышленного либо случайного уничтожения файлов. Мы решаем и эти вопросы посредством установки мощной и защищенной компьютерной сети.\r\nТаким образом, преимуществами работы с нами являются высокое качество и доступность оказываемых услуг, оперативность, отсутствие зависимости от одного работника, индивидуальный подход к каждому клиенту, своевременное и качественное обслуживания Ваших компьютеров.</p>\r\n\r\n<div style="text-align: center; margin-top: 40px; clear: both;">Благодарим за сотрудничество,</div>\r\n<a style="float: right; font-weight: bold; margin-top: 20px; margin-bottom: 30px;">Группа Q-IT</a>', 'Аутсорсинг ИТ', '', 'inherit', 'open', 'open', '', '145-revision-v1', '', '', '2014-04-25 10:03:53', '2014-04-25 10:03:53', '', 145, 'http://q-group.am/145-revision-v1/', 0, 'revision', '', 0),
