(640, 1, '2014-04-26 08:08:01', '2014-04-26 08:08:01', '<b>Кабельные системы</b>\r\n\r\nКабельная система объединяет локальную компьютерную сеть и телефонные сети, систему безопасности и т.п. Компания Q Group предлагает услуги по установке и обслуживанию как целостной системы, так и ее отдельных компонентов.\r\n\r\n<b>Предпроектное исследование</b>\r\n\r\nМы осуществляем проверку технического состояния и качества кабельных систем, определение категории планируемой кабельной системы, сроков работ, планирование бюджета.\r\n\r\n<b>Проектирование</b>\r\n\r\nПроектирование осуществляется нашими опытными специалистами на основании всей собранной информации и при взаимодействии с заказчиком.\r\n\r\n<b>Выполнение проекта</b>\r\n\r\nНа основании уже имеющегося проектного документа с применением необходимых устройств и материалов осуществляется проводка кабелей (проверка качества – Fluke Test), установка оборудования.\r\n\r\n<b>Системы цифрового </b><b>видео</b><b>наблюдения</b>\r\n\r\nКомпания Q Group выполняет установку, наладку (видеозапись, аудиозапись, возможность online  наблюдения) обеспечивающих безопасность IP видеокамер, DVR (цифровых видеорегистраторов).\r\n\r\n<b>АТС (Автоматическая телефонная станция)</b>\r\n\r\nМы предлагаем услуги по проведению сетей телефонных систем (кабелизация).', 'Интегратор ИТ', '', 'inherit', 'open', 'open', '', '261-revision-v1', '', '', '2014-04-26 08:08:01', '2014-04-26 08:08:01', '', 261, 'http://q-group.am/261-revision-v1/', 0, 'revision', '', 0);
