(641, 1, '2014-04-26 08:09:31', '2014-04-26 08:09:31', '<b>Cabling Systems</b>\r\n\r\nCabling system combines local computer network and telephone network, security systems and so on. Q Group company offers complete as well as individual components installation and maintenance services.\r\n\r\n&nbsp;\r\n\r\n<b>Carrying out Research before the Project . </b>We carry out Cabling Systems technical and quality checking, decision of the planned cable network category, giving deadlines, budget planning.\r\n\r\n&nbsp;\r\n\r\n<b>Projecting.</b> Based on the recruited (collected) information the projecting is performed by our experienced specialists with the mutual agreement of the client.\r\n\r\n&nbsp;\r\n\r\n<b>Implementation of the Project. </b>Based already on the existing project document, using the necessary devices and equipment, Installation of cable laying, /quality checking Fluke Test/ , installation of devices are performed .\r\n\r\n&nbsp;\r\n\r\n<b>Digital Viewing Systems.</b>\r\n\r\nQ Group implements the installation of IP cameras, DVR-s providing security, Configuration / video, audio, and the chance of online watching /.\r\n\r\n&nbsp;\r\n\r\n<b>ATS / Automatic Telephone Station /</b>\r\n\r\nHolding  telephone system network / Cabling /', 'IT Integration', '', 'inherit', 'open', 'open', '', '256-revision-v1', '', '', '2014-04-26 08:09:31', '2014-04-26 08:09:31', '', 256, 'http://q-group.am/256-revision-v1/', 0, 'revision', '', 0),
(642, 1, '2014-04-26 08:12:02', '2014-04-26 08:12:02', '<b>Кабельные системы\r\n</b>Кабельная система объединяет локальную компьютерную сеть и телефонные сети, систему безопасности и т.п. Компания Q Group предлагает услуги по установке и обслуживанию как целостной системы, так и ее отдельных компонентов.\r\n\r\n&nbsp;\r\n\r\n<b>Предпроектное исследование\r\n</b>Мы осуществляем проверку технического состояния и качества кабельных систем, определение категории планируемой кабельной системы, сроков работ, планирование бюджета.\r\n\r\n<b>Проектирование</b>\r\n\r\n<b>\r\n</b>Проектирование осуществляется нашими опытными специалистами на основании всей собранной информации и при взаимодействии с заказчиком.\r\n\r\n&nbsp;\r\n\r\n<b>Выполнение проекта\r\n</b>На основании уже имеющегося проектного документа с применением необходимых устройств и материалов осуществляется проводка кабелей (проверка качества – Fluke Test), установка оборудования.\r\n\r\n&nbsp;\r\n\r\n<b>Системы цифрового </b><b>видео</b><b>наблюдения\r\n</b>Компания Q Group выполняет установку, наладку (видеозапись, аудиозапись, возможность online  наблюдения) обеспечивающих безопасность IP видеокамер, DVR (цифровых видеорегистраторов).\r\n\r\n&nbsp;\r\n\r\n<b>АТС (Автоматическая телефонная станция)\r\n</b>Мы предлагаем услуги по проведению сетей телефонных систем (кабелизация).', 'Интегратор ИТ', '', 'inherit', 'open', 'open', '', '261-revision-v1', '', '', '2014-04-26 08:12:02', '2014-04-26 08:12:02', '', 261, 'http://q-group.am/261-revision-v1/', 0, 'revision', '', 0),
(643, 1, '2014-04-26 08:26:49', '2014-04-26 08:26:49', '<b style="line-height: 1.5em;">Кабельные системы</b>\r\n\r\nКабельная система объединяет локальную компьютерную сеть и телефонные сети, систему безопасности и т.п. Компания Q Group предлагает услуги по установке и обслуживанию как целостной системы, так и ее отдельных компонентов.\r\n\r\n&nbsp;\r\n\r\n<b>Предпроектное исследование\r\n</b>Мы осуществляем проверку технического состояния и качества кабельных систем, определение категории планируемой кабельной системы, сроков работ, планирование бюджета.\r\n\r\n&nbsp;\r\n\r\n<b>Проектирование\r\n</b>Проектирование осуществляется нашими опытными специалистами на основании всей собранной информации и при взаимодействии с заказчиком.\r\n\r\n<b>Выполнение проекта\r\n</b>На основании уже имеющегося проектного документа с применением необходимых устройств и материалов осуществляется проводка кабелей (проверка качества – Fluke Test), установка оборудования.\r\n\r\n&nbsp;\r\n\r\n<b>Системы цифрового </b><b>видео</b><b>наблюдения\r\n</b>Компания Q Group выполняет установку, наладку (видеозапись, аудиозапись, возможность online  наблюдения) обеспечивающих безопасность IP видеокамер, DVR (цифровых видеорегистраторов).\r\n\r\n&nbsp;\r\n\r\n<b>АТС (Автоматическая телефонная станция)\r\n</b>Мы предлагаем услуги по проведению сетей телефонных систем (кабелизация).\r\n\r\n<a style="float: right;"> </a>', 'Integration', '', 'inherit', 'open', 'open', '', '112-revision-v1', '', '', '2014-04-26 08:26:49', '2014-04-26 08:26:49', '', 112, 'http://q-group.am/112-revision-v1/', 0, 'revision', '', 0),
(644, 1, '2014-04-26 08:28:01', '2014-04-26 08:28:01', 'Հարգելի գործընկեր,\r\n\r\n&nbsp;\r\n\r\n<b>Մալուխային համակարգեր.</b>\r\n\r\n<b>\r\n</b>Մալուխային համակարգը միավորում է լոկալ համակարգչային ցանցը և հեռախոսային ցանցերը, անվտանգության համակարգերը և այլն։  Q Group ընկերությունն առաջարկում է ինչպես ամբողջական, այնպես էլ առանձին բաղադրիչների տեղադրման ու սպասարկման ծառայություններ։\r\n\r\n<b> </b>\r\n\r\n<b>Նախագծումից առաջ կատարվող հետազոտություն։</b> Իրականացնում ենք մալուխային համակարգերի տեխնիկական վիճակի և որակի  ստուգում, պլանավորվող մալուխային ցանցի կատեգորիայի որոշում, ժամկետների  նշանակում, բյուջեի պլանավորում։\r\n\r\n<b> </b>\r\n\r\n<b>Նախագծում։</b>  Հավաքագրված ողջ ինֆորմացիայի հիման վրա նախագծումն իրականացնում ենք մեր փորձառու մասնագետների կողմից պատվիրատուի հետ փոխադարձ համաձայնությամբ։\r\n\r\n<b> </b>\r\n\r\n<b>Նախագծի իրականացում։</b> Արդեն առկա նախագծային փաստաթղթի հիման վրա՝ օգտագործելով  անհրաժեշտ սարքեր և սարքավորումներ, իրականացվում են մալուխների անցկացում /որակի ստուգում՝ Fluke Test/, սարքերի տեղադրում։\r\n\r\n<b> </b>\r\n\r\n<b>Թվային դիտման համակարգեր</b>\r\n\r\nQ Group-ն իրականացնում է անվտանգությունն ապահովվող IP տեսախցիկների, DVR-ների  տեղադրում, կարգավորում /տեսագրություն, ձայնագրություն, online դիտման հնարավորություն/\r\n\r\n&nbsp;\r\n\r\n<b>ATS / ԱՀԿ  /Ավտոմատ հեռախոսային կայան/</b>\r\n\r\nՀեռախոսային համակարգի ցանցի անցկացում /Cabeling/<b></b>\r\n<p style="text-align: right;">"Q IT" խումբ:</p>\r\n\r\n<div style="text-align: right;">Ուրախ կլինենք համագործակցել:</div>\r\n<div style="text-align: right;"></div>\r\n<p style="text-align: right;"><a>Շնորհակալություն մեր ծառայություններից օգտվելու համար:</a></p>\r\n<a style="float: right;"> </a>', 'Integration', '', 'inherit', 'open', 'open', '', '112-revision-v1', '', '', '2014-04-26 08:28:01', '2014-04-26 08:28:01', '', 112, 'http://q-group.am/112-revision-v1/', 0, 'revision', '', 0),
