(669, 1, '2014-04-26 09:33:49', '2014-04-26 09:33:49', '<strong>Q-IT</strong>\r\n\r\n&nbsp;\r\n\r\nКомпания Q-IT более 5 лет работает на рынке профессиональных IT услуг. Мы предлагаем Вам комплексное системное администрирование сетей, ИТ консалтинг, абонентское обслуживание ПК, обслуживание компьютерной техники, высококачественную IT поддержку пользователей на базе лучших мировых стандартов и методологий, а также полный комплекс IT услуг на основе схемы IT аутсорсинга.\r\n\r\n&nbsp;\r\n\r\n<strong>Интегратор ИТ</strong>\r\n\r\n<b>Кабельные системы</b>\r\n\r\nКабельная система объединяет локальную компьютерную сеть и телефонные сети, систему безопасности и т.п. Компания Q Group предлагает услуги по установке и обслуживанию как целостной системы, так и ее отдельных компонентов.\r\n\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Почему Q-IT:</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">Более 5-и лет успешной работы на рынке IT услуг\r\nТолько положительные отзывы и рекомендации клиентов\r\nВысокие стандарты контроля качества\r\n24/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Аутсорсинг (от англ. outsourcing: внешний источник) - передача организацией определённых бизнес-процессов или производственных функций на обслуживание другой компании, специализирующейся в соответствующей области.</p>', 'О нас', '', 'inherit', 'open', 'open', '', '155-revision-v1', '', '', '2014-04-26 09:33:49', '2014-04-26 09:33:49', '', 155, 'http://q-group.am/155-revision-v1/', 0, 'revision', '', 0),
(670, 1, '2014-04-26 09:34:06', '2014-04-26 09:34:06', '<strong>Q-IT</strong>\r\n\r\n&nbsp;\r\n\r\nКомпания Q-IT более 5 лет работает на рынке профессиональных IT услуг. Мы предлагаем Вам комплексное системное администрирование сетей, ИТ консалтинг, абонентское обслуживание ПК, обслуживание компьютерной техники, высококачественную IT поддержку пользователей на базе лучших мировых стандартов и методологий, а также полный комплекс IT услуг на основе схемы IT аутсорсинга.\r\n\r\n&nbsp;\r\n\r\n<strong>Интегратор ИТ</strong>\r\n\r\n&nbsp;\r\n\r\n<b>Кабельные системы</b>\r\n\r\nКабельная система объединяет локальную компьютерную сеть и телефонные сети, систему безопасности и т.п. Компания Q Group предлагает услуги по установке и обслуживанию как целостной системы, так и ее отдельных компонентов.\r\n\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Почему Q-IT:</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">Более 5-и лет успешной работы на рынке IT услуг\r\nТолько положительные отзывы и рекомендации клиентов\r\nВысокие стандарты контроля качества\r\n24/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Аутсорсинг (от англ. outsourcing: внешний источник) - передача организацией определённых бизнес-процессов или производственных функций на обслуживание другой компании, специализирующейся в соответствующей области.</p>', 'О нас', '', 'inherit', 'open', 'open', '', '155-revision-v1', '', '', '2014-04-26 09:34:06', '2014-04-26 09:34:06', '', 155, 'http://q-group.am/155-revision-v1/', 0, 'revision', '', 0),
