(672, 1, '2014-04-26 09:35:35', '2014-04-26 09:35:35', '<strong>Q-IT</strong>\r\n\r\nCompany Q-IT has been working in the market of professional IT Services for more than 5 years of experience. We offer you a complete system of network management, IT consulting, PC subscription service, maintenance service, high-quality IT support to users which is based on the international best standards and methods as well as full complex of IT services based on the IT outsourcing scheme.\r\n\r\n&nbsp;\r\n\r\n<b>Q-Integrator </b>\r\n\r\nCabling system combines local computer network and telephone network, security systems and so on. Q Group company offers complete as well as individual components installation and maintenance services.\r\n\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Why Q-IT?</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">More than 5 years of successful work in the IT services market\r\nOnly positive responses and customers'' preference\r\nHigh standards of quality control\r\n24/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Outsourcing (from English-outsourcing: external source) transfers the service of the organization''s specific business process or another organization''s business functions specialized in the appropriate field.</p>', 'About us', '', 'inherit', 'open', 'open', '', '24-revision-v1', '', '', '2014-04-26 09:35:35', '2014-04-26 09:35:35', '', 24, 'http://q-group.am/24-revision-v1/', 0, 'revision', '', 0),
