(1228, 1, '2015-01-16 07:37:28', '2015-01-16 07:37:28', 'Q-IT\r\n<p style="margin-top: 15px;">Company Q-IT has been working in the market of professional IT Services for more than 5 years of experience. We offer you a comprehensive system administration of networks, IT consulting, PC subscription service, maintenance of computer equipment, high-quality IT support to the users based on the best international standards and methodologies, as well as a full range of IT services based on the schema of IT outsourcing.</p>\r\n<p style="margin-top: 15px;">Why Q-IT?</p>\r\n<p style="margin-top: 15px; margin-left: 35px;">More than 6 years of successful work in the IT services market\r\nOnly positive reviews and recommendations of the customers\r\nHigh standards of quality control\r\n24/7/365</p>\r\n<p style="margin-top: 15px;">Outsourcing (from English-outsourcing: external source)-to send the organization of certain business processes or business functions to serve other company, specializing in the corresponding field.</p>', ' IT Ousourcing', '', 'inherit', 'closed', 'closed', '', '239-revision-v1', '', '', '2015-01-16 07:37:28', '2015-01-16 07:37:28', '', 239, 'http://q-group.am/239-revision-v1/', 0, 'revision', '', 0),
(1229, 1, '2015-01-16 07:37:47', '2015-01-16 07:37:47', 'Q-IT\r\n<p style="margin-top: 15px;">Q-IT Ընկերությունը գործում է IT պրոֆեսիոնալ ծառայությունների շուկայում ավելի քան 5 տարի: Մենք առաջարկում ենք Ձեզ ցանցերի ամբողջական համակարգող կառավարում, խորհրդատվություն, ԱՀ բաժանորդագրային ծառայություն, տեխնիկական սպասարկում, բարձրորակ աջակցություն օգտվողներին, որը հիմնված է միջազգային լավագույն ստանդարտների և մեթոդիկայի վրա, ինչպես նաև IT ծառայությունների լիարժեք կոմպլեքս` հիմնված աութսոուրսինգի սխեմայի վրա:</p>\r\n<p style="margin-top: 15px;">Ինչու Q-IT</p>\r\n<p style="margin-top: 15px; margin-left: 35px;">Ավելի քան 6 տարի հաջողությամբ աշխատում է IT ծառայությունների շուկայում\r\nՄիայն դրական արձագանքներ և հաճախորդների նախապատվություն\r\nՈրակի վերահսկման բարձր չափանիշներ\r\n24/7/365</p>\r\n<p style="margin-top: 15px;">Աութսոուրսինգ (անգլ. outsourcing: արտաքին աղբյուր)-փոխանցում է կազմակերպության կոնկրետ բիզնես գործընթացի կամ մեկ այլ կազմակերպության բիզնես գործառույթների ծառայությունը` մասնագիտացված համապատասխան ոլորտում:</p>', 'ՏՏ Աութսորսինգ', '', 'inherit', 'closed', 'closed', '', '251-revision-v1', '', '', '2015-01-16 07:37:47', '2015-01-16 07:37:47', '', 251, 'http://q-group.am/251-revision-v1/', 0, 'revision', '', 0),
(1230, 1, '2015-01-16 07:38:03', '2015-01-16 07:38:03', 'Q-IT\r\n<p style="margin-top: 15px;">Компания Q-IT более 5 лет работает на рынке профессиональных IT услуг. Мы предлагаем Вам комплексное системное администрирование сетей, ИТ консалтинг, абонентское обслуживание ПК, обслуживание компьютерной техники, высококачественную IT поддержку пользователей на базе лучших мировых стандартов и методологий, а также полный комплекс IT услуг на основе схемы IT аутсорсинга.</p>\r\n<p style="margin-top: 15px;">Почему Q-IT:</p>\r\n<p style="margin-top: 15px; margin-left: 35px;">· Более 6-и лет успешной работы на рынке IT услуг\r\n· Только положительные отзывы и рекомендации клиентов\r\n· Высокие стандарты контроля качества\r\n. 24/7/365</p>\r\n<p style="margin-top: 15px;">Аутсорсинг (от англ. outsourcing: внешний источник) - передача организацией определённых бизнес-процессов или производственных функций на обслуживание другой компании, специализирующейся в соответствующей области.</p>', 'Аутсорсинг ИТ', '', 'inherit', 'closed', 'closed', '', '253-revision-v1', '', '', '2015-01-16 07:38:03', '2015-01-16 07:38:03', '', 253, 'http://q-group.am/253-revision-v1/', 0, 'revision', '', 0),
