(1235, 1, '2015-01-16 07:41:36', '2015-01-16 07:41:36', '<strong>Q-IT</strong>\r\n\r\nCompany Q-IT has been working in the market of professional IT Services for more than 6 years of experience. We offer you a complete system of network management, IT consulting, PC subscription service, maintenance service, high-quality IT support to users which is based on the international best standards and methods as well as full complex of IT services based on the IT outsourcing scheme.\r\n\r\n&nbsp;\r\n\r\n<b>Q-Integration</b>\r\n\r\nCabling system combines local computer network and telephone network, security systems and so on. Q Group company offers complete as well as individual components installation and maintenance services.\r\n\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Why Q-IT?</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">More than 6 years of successful work in the IT services market\r\nOnly positive responses and customers'' preference\r\nHigh standards of quality control\r\n24/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Outsourcing (from English-outsourcing: external source) transfers the service of the organization''s specific business process or another organization''s business functions specialized in the appropriate field.</p>', 'About us', '', 'inherit', 'closed', 'closed', '', '24-revision-v1', '', '', '2015-01-16 07:41:36', '2015-01-16 07:41:36', '', 24, 'http://q-group.am/24-revision-v1/', 0, 'revision', '', 0),
(1236, 1, '2015-01-16 07:41:54', '2015-01-16 07:41:54', '<strong>Q-IT</strong>\r\n\r\n&nbsp;\r\n\r\nQ-IT Ընկերությունը գործում է IT պրոֆեսիոնալ ծառայությունների շուկայում ավելի քան 6 տարի: Մենք առաջարկում ենք Ձեզ ցանցերի ամբողջական համակարգող կառավարում, խորհրդատվություն, ԱՀ բաժանորդագրային ծառայություն, տեխնիկական սպասարկում, բարձրորակ աջակցություն օգտվողներին, որը հիմնված է միջազգային լավագույն ստանդարտների և մեթոդիկայի վրա, ինչպես նաև IT ծառայությունների լիարժեք կոմպլեքս` հիմնված աութսոուրսինգի սխեմայի վրա:\r\n\r\n&nbsp;\r\n\r\n<strong>Q-Integration</strong>\r\n\r\n&nbsp;\r\n\r\n<b>Մալուխային համակարգեր\r\n</b>Մալուխային համակարգը միավորում է լոկալ համակարգչային ցանցը և հեռախոսային ցանցերը, անվտանգության համակարգերը և այլն։  Q Group ընկերությունն առաջարկում է ինչպես ամբողջական, այնպես էլ առանձին բաղադրիչների տեղադրման ու սպասարկման ծառայություններ։\r\n\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Ինչու Q-IT</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">Ավելի քան 6 տարի հաջողությամբ աշխատում է IT ծառայությունների շուկայում\r\nՄիայն դրական արձագանքներ և հաճախորդների նախապատվություն\r\nՈրակի վերահսկման բարձր չափանիշներ\r\n4/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Աութսոուրսինգ (անգլ. outsourcing: արտաքին աղբյուր)-փոխանցում է կազմակերպության կոնկրետ բիզնես գործընթացի կամ մեկ այլ կազմակերպության բիզնես գործառույթների ծառայությունը` մասնագիտացված համապատասխան ոլորտում:</p>', 'Մեր մասին', '', 'inherit', 'closed', 'closed', '', '108-revision-v1', '', '', '2015-01-16 07:41:54', '2015-01-16 07:41:54', '', 108, 'http://q-group.am/108-revision-v1/', 0, 'revision', '', 0),
(1237, 1, '2015-01-16 07:42:12', '2015-01-16 07:42:12', '<strong>Q-IT</strong>\r\n\r\n&nbsp;\r\n\r\nКомпания Q-IT более 6 лет работает на рынке профессиональных IT услуг. Мы предлагаем Вам комплексное системное администрирование сетей, ИТ консалтинг, абонентское обслуживание ПК, обслуживание компьютерной техники, высококачественную IT поддержку пользователей на базе лучших мировых стандартов и методологий, а также полный комплекс IT услуг на основе схемы IT аутсорсинга.\r\n\r\n&nbsp;\r\n\r\n<strong>Q-Интегратор </strong>\r\n\r\n&nbsp;\r\n\r\n<b>Кабельные системы</b>\r\n\r\nКабельная система объединяет локальную компьютерную сеть и телефонные сети, систему безопасности и т.п. Компания Q Group предлагает услуги по установке и обслуживанию как целостной системы, так и ее отдельных компонентов.\r\n\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Почему Q-IT:</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">Более 6-и лет успешной работы на рынке IT услуг\r\nТолько положительные отзывы и рекомендации клиентов\r\nВысокие стандарты контроля качества\r\n24/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Аутсорсинг (от англ. outsourcing: внешний источник) - передача организацией определённых бизнес-процессов или производственных функций на обслуживание другой компании, специализирующейся в соответствующей области.</p>', 'О нас', '', 'inherit', 'closed', 'closed', '', '155-revision-v1', '', '', '2015-01-16 07:42:12', '2015-01-16 07:42:12', '', 155, 'http://q-group.am/155-revision-v1/', 0, 'revision', '', 0),
