(1440, 3, '2015-08-25 07:02:25', '2015-08-25 07:02:25', 'Q-IT\r\n<p style="margin-top: 15px;">Q-IT Ընկերությունը գործում է IT պրոֆեսիոնալ ծառայությունների շուկայում ավելի քան 6 տարի: Մենք առաջարկում ենք Ձեզ ցանցերի ամբողջական համակարգող կառավարում, խորհրդատվություն, ԱՀ բաժանորդագրային ծառայություն, տեխնիկական սպասարկում, բարձրորակ աջակցություն օգտվողներին, որը հիմնված է միջազգային լավագույն ստանդարտների և մեթոդիկայի վրա, ինչպես նաև IT ծառայությունների լիարժեք կոմպլեքս` հիմնված աութսոուրսինգի սխեմայի վրա:</p>\r\n<p style="margin-top: 15px;">Ինչու Q-IT</p>\r\n<p style="margin-top: 15px; margin-left: 35px;">Ավելի քան 6 տարի հաջողությամբ աշխատում է IT ծառայությունների շուկայում\r\nՄիայն դրական արձագանքներ և հաճախորդների նախապատվություն\r\nՈրակի վերահսկման բարձր չափանիշներ\r\n  24/7/365</p>\r\n<p style="margin-top: 15px;">Աութսոուրսինգ (անգլ. outsourcing: արտաքին աղբյուր)-փոխանցում է կազմակերպության կոնկրետ բիզնես գործընթացի կամ մեկ այլ կազմակերպության բիզնես գործառույթների ծառայությունը` մասնագիտացված համապատասխան ոլորտում:</p>', 'ՏՏ Աութսորսինգ', '', 'inherit', 'closed', 'closed', '', '251-revision-v1', '', '', '2015-08-25 07:02:25', '2015-08-25 07:02:25', '', 251, 'http://q-group.am/251-revision-v1/', 0, 'revision', '', 0),
(1442, 3, '2015-08-25 07:06:08', '2015-08-25 07:06:08', '<strong>Q-IT</strong>\r\n\r\n&nbsp;\r\n\r\nQ-IT Ընկերությունը գործում է IT պրոֆեսիոնալ ծառայությունների շուկայում ավելի քան 6 տարի: Մենք առաջարկում ենք Ձեզ ցանցերի ամբողջական համակարգող կառավարում, խորհրդատվություն, ԱՀ բաժանորդագրային ծառայություն, տեխնիկական սպասարկում, բարձրորակ աջակցություն օգտվողներին, որը հիմնված է միջազգային լավագույն ստանդարտների և մեթոդիկայի վրա, ինչպես նաև IT ծառայությունների լիարժեք կոմպլեքս` հիմնված աութսոուրսինգի սխեմայի վրա:\r\n\r\n&nbsp;\r\n\r\n<strong>Q-Integration</strong>\r\n\r\n&nbsp;\r\n\r\n<b>Մալուխային համակարգեր\r\n</b>Մալուխային համակարգը միավորում է լոկալ համակարգչային ցանցը և հեռախոսային ցանցերը, անվտանգության համակարգերը և այլն։  Q Group ընկերությունն առաջարկում է ինչպես ամբողջական, այնպես էլ առանձին բաղադրիչների տեղադրման ու սպասարկման ծառայություններ։\r\n\r\n&nbsp;\r\n\r\n<strong style="margin-top: 10px;">Ինչու Q-IT</strong>\r\n<p style="margin-top: 10px; margin-bottom: 10px; margin-left: 40px;">Ավելի քան 6 տարի հաջողությամբ աշխատում է IT ծառայությունների շուկայում\r\nՄիայն դրական արձագանքներ և հաճախորդների նախապատվություն\r\nՈրակի վերահսկման բարձր չափանիշներ\r\n24/7/365</p>\r\n<p style="margin-top: 10px; margin-bottom: 45px;">Աութսոուրսինգ (անգլ. outsourcing: արտաքին աղբյուր)-փոխանցում է կազմակերպության կոնկրետ բիզնես գործընթացի կամ մեկ այլ կազմակերպության բիզնես գործառույթների ծառայությունը` մասնագիտացված համապատասխան ոլորտում:</p>', 'Մեր մասին', '', 'inherit', 'closed', 'closed', '', '108-revision-v1', '', '', '2015-08-25 07:06:08', '2015-08-25 07:06:08', '', 108, 'http://q-group.am/108-revision-v1/', 0, 'revision', '', 0),
